import React from 'react';
// import '../../App.css';
import './home.css'


export default function Home() {
  return (
    <>
      <div className="container">
        <div className="title">
          <h1>Profile</h1>
        </div>
        <div className="row">
          <div className="col-md-5">
            <div className="photo">{Image()}</div>
          </div>
          <div className="col-md-7 ">
            <div class="card">
              <div class="card-body">
                This is some text within a card body.
              </div>
            </div></div>
        </div>
      </div>

    </>
  );

}
